- input: "TEXT\x1CC00272732\x1CX0\x1C\x1CF3N\x1CAfter undertaking a thorough review
    of its outstanding debts, Friends of Corrine Brown (The Committee), per Advisory
    Opinion 1999-38, is hereby discontinuing its reporting of the debts listed on
    Schedule D of its July Quarterly (2010) report. Along with attempting by telephone
    to reach the vendors with which the Committee had disputed debts - dating back
    to the years 2000-2002 -- the Committee sent certified letters to each of these
    vendors. Several vendors responded and, as a result, the Committee has paid off
    several debts during recent reporting periods. For the remaining debts, the Committee
    has concluded that the vendors do not indicate any intent to collect any possible
    debts owed by the committee and that the debts may be hereby discharged.\n"
